def wordSubsets(A, B):
    import collections

    bmax = collections.defaultdict(int)
    for b in B:
        ct = collections.Counter(b)
        for k,v in ct.items():
            bmax[k] = max(bmax[k], v)

    def isSubset(word):
        counter = collections.Counter(word)
        for k,v in bmax.items():
            if k not in counter.keys() or counter[k]<v:
                return False
        return True

    return filter(isSubset, A)

def wordSubsets2(A, B):
    d = {}
    out = []
    for i in B:
        for j in i:
            if j not in d or d[j] < i.count(j):
                d[j] = i.count(j)

    for x in A:
        flag = True
        for y in d.keys():
            if x.count(y) < d[y]:
                flag = False
                break
        if flag:
            out.append(x)

    return out

